// Initialize locales from URL parameters
// This ensures ALL apps work with translations, even if they don't set locales themselves
(function initializeLocales() {
    // Only run in browser environment
    if (typeof window === 'undefined') return;

    const urlParams = new URLSearchParams(window.location.search);

    // Set up UI locale (interface language)
    // Priority: ?locale= > ?ui= > browser language > 'en'
    if (!window.uiLocale) {
        const paramLocale = urlParams.get('locale') || urlParams.get('ui');
        const browserLang = (navigator.language || navigator.userLanguage || 'en').split('-')[0];

        // Check if we support this language
        const supportedLangs = Object.keys(window.translations || {});
        let uiLocale = 'en';

        if (paramLocale && supportedLangs.includes(paramLocale)) {
            uiLocale = paramLocale;
        } else if (supportedLangs.includes(browserLang)) {
            uiLocale = browserLang;
        }

        window.uiLocale = uiLocale;
    }

    // Set up content locale (worksheet language)
    // Priority: ?content= > uiLocale
    if (!window.currentLocale) {
        const contentParam = urlParams.get('content');
        window.currentLocale = contentParam || window.uiLocale || 'en';
    }

    // Also set contentLocale alias for clarity
    window.contentLocale = window.currentLocale;

    console.log('🌍 Locales initialized - UI:', window.uiLocale, 'Content:', window.currentLocale);
})();

// Make globally accessible
window.translations = translations;

// Translation function
function t(key) {
    const locale = window.uiLocale || window.currentLocale || 'en';  // Use UI locale for interface

    if (!window.translations) {
        console.warn('Translations not loaded');
        return key;
    }

    const translation = (window.translations[locale] && window.translations[locale][key]) ||
                       (window.translations['en'] && window.translations['en'][key]) ||
                       key;

    return translation;
}


// Make t function globally accessible
window.t = t;

/**
 * Translate all elements on the page with data-translate attributes
 * This function is called by all worksheet generator apps
 */
function translatePage() {
    const locale = window.currentLocale || window.uiLocale || 'en';

    // Translate elements with data-translate attribute (text content)
    document.querySelectorAll('[data-translate]').forEach(element => {
        const key = element.getAttribute('data-translate');
        const translation = t(key);

        if (translation && translation !== key) {
            // For option elements, preserve the value
            if (element.tagName === 'OPTION') {
                const originalValue = element.value;
                element.textContent = translation;
                if (originalValue) element.value = originalValue;
            } else {
                element.textContent = translation;
            }
        }
    });

    // Translate placeholders
    document.querySelectorAll('[data-translate-placeholder]').forEach(element => {
        const key = element.getAttribute('data-translate-placeholder');
        const translation = t(key);
        if (translation && translation !== key) {
            element.placeholder = translation;
        }
    });

    // Translate titles (tooltips)
    document.querySelectorAll('[data-translate-title]').forEach(element => {
        const key = element.getAttribute('data-translate-title');
        const translation = t(key);
        if (translation && translation !== key) {
            element.title = translation;
        }
    });

    // Translate values (for inputs)
    document.querySelectorAll('[data-translate-value]').forEach(element => {
        const key = element.getAttribute('data-translate-value');
        const translation = t(key);
        if (translation && translation !== key) {
            element.value = translation;
        }
    });

    // Update document title if it has data-translate
    const titleElement = document.querySelector('title[data-translate]');
    if (titleElement) {
        const key = titleElement.getAttribute('data-translate');
        const translation = t(key);
        if (translation && translation !== key) {
            document.title = translation;
        }
    }

    console.log(`✅ Page translated to ${locale}`);
}

// Make translatePage globally accessible
window.translatePage = translatePage;

// Auto-translate on page load
if (typeof document !== 'undefined') {
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', function() {
            // Small delay to ensure everything is loaded
            setTimeout(translatePage, 100);
        });
    } else {
        // Page already loaded, translate immediately
        setTimeout(translatePage, 100);
    }
}


// Log on load
if (typeof document !== 'undefined') {
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', function() {
            const langs = Object.keys(window.translations);
            const totalKeys = langs.reduce((sum, lang) => sum + Object.keys(window.translations[lang]).length, 0);
            console.log('✅ Translations ready: ' + langs.length + ' languages, ' + totalKeys + ' total keys');
        });
    } else {
        const langs = Object.keys(window.translations);
        const totalKeys = langs.reduce((sum, lang) => sum + Object.keys(window.translations[lang]).length, 0);
        console.log('✅ Translations ready: ' + langs.length + ' languages, ' + totalKeys + ' total keys');
    }
}

// Alias for unified-language-manager compatibility
window.applyTranslations = translatePage;
